import Nav from './components/Nav/Nav';
import Dogs from './components/Dogs/Nav'
import './App.css';

function App() {
  return (
    <div className="App">
       {/* <Route path="/" element={<Nav />}> */}
       <Routes>
       <Route path="/" element={<Nav />} />
       <Route path="/hola" element={< Dogs />} />
      </Routes>
    </div> 
  );
}

export default App;
